INSERT INTO `announcements` VALUES (1,'Dearest FlockUp users, [Flock](http://flock.com) has served us a cease & desist letter regarding their \'Flock\' trademark. In order to avoid customer confusion, we will be rebranding and changing domains in the very near future. At the latest, this will occur by February 13th, 2009. The curious can find the letter here: [part 1](http://localhost:3000/images/flockup-cd-1.png) [part 2](http://localhost:3000/images/flockup-cd-2.png)','2009-01-12 00:00:00','2009-02-13 23:59:00','2009-01-21 22:41:12','2009-01-21 22:41:12'),(2,'We\'ve decided on a new name: TweetFleet. Most of our content should reflect this now, and we\'ll be moving to a new domain name soon.','2009-01-19 22:41:00','2009-02-13 23:59:00','2009-01-21 22:42:18','2009-01-21 22:46:51'),(3,'[tweetfleet.technicalpickles.com](http://tweetfleet.technicalpickles.com) will be interim home for TweetFleet. Maybe we\'ll get a top level domain soon...','2009-01-28 18:45:00','2009-02-13 18:45:00','2009-01-28 18:47:11','2009-01-28 18:47:11');
/*!40000 ALTER TABLE `announcements` ENABLE KEYS */;
